import logo from './logo.svg';
import './App.css';
import Home from './Home';
import { BrowserRouter, Route, Routes, Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import Post from './Component/Posts/Post';
import Contact from './Components/Contact';
import About from './Components/About';
import { UilUser } from '@iconscout/react-unicons';
import Footer from './Components/Footer';
import Header from './Component/Header';
import {Helmet} from "react-helmet";
function App() {
  return (      
    <> 
    <Header />
    <Helmet>
    <script src="./js/aos.js" type="text/jsx" />
    <script src="./js/glightbox.js" type="text/jsx" />
    <script src="./js/glightbox.min.js" type="text/jsx" />
    <script src="./js/main-jquery.js" type="text/jsx" />
    <script src="./js/main.js" type="text/jsx" />
    <script src="./js/modernizr.js" type="text/jsx" />
    <script src="./js/plugins.js" type="text/jsx" />
    <script src="./js/purecounter_vanilla.js" type="text/jsx" />
    <script src="./js/swiper-bundle.min.js" type="text/javascript" />
    <script src="./js/validate.js" type="text/javascript" />
    <script src="./js/jquery-3.2.1.js" type="text/javascript" />







    </Helmet>
   
      <BrowserRouter>
        <Routes>
          <Route path='/post' element={<Post />}>Post Page</Route>
          <Route path='/' element={<Home />}>Landing page</Route>
          <Route path='/Home' element={<Home />} />
          {/* <Route path='/Register' element={<Register />} /> */}
          {/* <Route path='/Login' element={<Login />} /> */}
          {/* <Route path='/:userid' element={<Home />} /> */}
          <Route path='/About' element={<About />} />
          <Route path='/Contact' element={<Contact />} />
          {/* <Route path='/MyAccount' element={<UserPro />} /> */}
        </Routes>
      </BrowserRouter>
      <Footer/>
      </>
  );
}

export default App;
